import React from 'react'
import { Button } from "react-native";
import { linkTo } from '../commons/util.common';

const HomeScreen = ({navigation}) => (
    <Button
        title="prueba"
        onPress={()=> linkTo(navigation, 'Profile', {name: 'Jane'})}
    />
)

export default HomeScreen
